import React, { useState } from 'react';
import '../App.css';

function valueButtons() {
    const [buttons, setButtons] = useState({
        xButton: {
            text: 'X',
            value: 10,
            color: 'gold'
        },
        tenButton: {
            text: '10',
            value: 10,
            color: 'gold'
        }
    })
    return (
        <div className = "button-group">
            <p>{buttons.xButton.text}</p>
        </div>
    )
};

export default valueButtons;
